法律责任。用户承担法律责任的形式包括但不限于：对受到侵害者进行赔偿，以及在通付宝公司首先承担了因用户行为导致的行政处罚或侵权损害赔偿责任后，用户应给与通付宝公司等额的赔偿。\r\n服务费用：当您使用通付宝服务时，通付宝公司会向您收取相关服务费用。各项服务费用请详见您使用通付宝服务时通付宝网站上所列之收费方式说明。通付宝公司保留有订定及调整服务费之权利。\r\n您同意，除非另有说明，上述服务费用通付宝公司有权自通付宝公司代收向您支付的款项中扣除。\r\n暂停、拒绝或终止您的使用\r\n您同意通付宝公司有权基于单方独立判断，包括但不限于通付宝公司认为您已经违反本服务条款的规定，将暂停、中断或终止向您提供“通付宝”服务（或其他部分），并将“通付宝”服务内任何“用户资料”加以移除并删除。\r\n您同意通付宝公司在发现异常交易或疑义或有违法之虞时，不经通知有权先行暂停或终止您的账户、密码，并拒绝您使用“通付宝”服务之外部分或全部功能。\r\n您同意在必要时，通付宝公司无需进行事先通知即得终止提供“通付宝”服务，并可能立即暂停、关闭或删除您的账户及您账户中所有相关资料及档案。\r\n通付宝用户账户安全性\r\n您了解并同意，确保密码及账户的机密安全是您的责任，您将对利用该密码及账户所进行的一切行动及言论，负完全的责任，并同意以下事项：\r\n您不可对其他任何人泄露您的账户或密码，亦不可使用其他任何人的账户或密码\r\n您同意如发现有第三人冒用或盗用您的账户和密码，或其他任何未经合法授权的情形，应立即以有效方式通知通付宝公司，同意暂停其使用本服务并采取有效防范措施。通付宝公司在接受您的有效同之前，对第三人使用该服务已发生制效力，除非可证明通付宝公司故意或重大过失而不知是未经合法授权之使用，否则通付宝公司将不承担任何责任。\r\n系统服务中断或故障\r\n系统因下列状况无法正常运作，使用户无法使用各项服务时，通付宝公司对您不负任何赔偿责任，包括但不限于：\r\n通付宝公司系统停机维护期间\r\n手机设备出现故障不能进行数据传输的。\r\n因台风、地震、还小、洪水、停电、战争、恐怖袭击等不可抗力因素，造成通付宝公司系统故障不能执行业务的。\r\n责任范围及责任限制\r\n通付宝公司仅对本协议中所列明的义务承担责任\r\n您明确因交易产生的任何风险应有交易双方承担。\r\n用户信息是有用户自行发布，通付宝公司无法保证用户信息的真实、及时和完整、您应对您的判断承担全部责任\r\n通付宝公司未对交易标的及“通付宝”服务提供任何形式的保证，包括但不限于以下事项：\r\n“通付宝”服务将符合您的需求\r\n“通付宝”服务将不受干扰、及时提供或免于出错。\r\n您经由“通付宝”服务购买或取得之任何产品、服务、资讯或其他资料将符合您的期望。\r\n“通付宝”服务的合作单位，所提供的服务品质及内容由该合作单位自行负责。\r\n您经由“通付宝”服务的使用下载或取得任何资料，应由您自行考量且自负风险，因资料的下载而导致您手机系统的任何损坏或资料六十，您应负完全责任。\r\n您自通付宝供公司及公司工作人员或经由“通付宝”服务取得的建议或咨询，无论其为书面或口头，均不构成通付宝公司对“通付宝”服务的任何保证\r\n在法律允许的情况下，通付宝公司对于与本协议有关或由本协议引起的任何间接的、惩罚性的、特殊的、派生的损失（包括业务损失、收益损失、利润损失、使用数据或其他经济利益损失），不论是如何产生的，也不论是由本协议的违约（包括违反保证）还是由侵权造成的，均不负有任何责任，即使其事先已被告知此等损失的可能性。另外即使本协议规定的排他性救济没用达到其基本目的。也应排除通付宝公司对上述损失的责任。\r\n隐私权保护\r\n通付宝公司重视对用户隐私的保护，关于您的用户资料和其他特定资料依通付宝公司收到保护与规范\r\n知识产权的保护	\r\n手机客户端上所有内容，包括但不限于著作、图片、档案、资讯、资料、网站架构、网站画面的安排、网页设计、均有通付宝公司或其他有权利人依法拥有其知识产权、包括但不限于商标权、专利权、著作权、商业秘密等。\r\n非经通付宝公司或其他权利人书面同意任何人不得擅自使用、修改、复制、公开传播、改变、散步、发行或公开发表软件程序或内容。\r\n尊重知识产权是您应尽的义务。如有违反，您应对通付宝公司承担损害赔偿责任。\r\n服务条款的解释、法律适用及争端解决\r\n通付宝公司对本服务条款拥有最终解释权\r\n本协议及其修订本的有效性、履行和与本协议及其修订本效力有关的所有事宜，将受中华人民共和国法律管辖，任何争议仅适用中国人民共和国法律。\r\n因本协议所引起的用户通付宝公司的任何纠纷或争议，首先应友好协商解决，协商不成的，用户在此完全同意将纠纷或争议提交到通付宝公司所在地人民法院诉讼解决。', 2, NULL);
