INSERT INTO `web_help` (`fd_help_id`, `fd_help_no`, `fd_help_type`, `fd_help_name`, `fd_help_url`, `fd_help_contect`, `fd_help_state`, `fd_help_date`) VALUES(1, 1, 1, '通付宝介绍', '', '感谢您使用通付宝V1.0版本手机客户端。在通付宝中，我们为您提供通付宝借记卡间的转帐汇款、借记卡对信用卡的还款、归还贷款，以及信用卡购买现金抵用券功等能，持有通付宝，资金管理只需几秒！', 0, '2013-08-23');
INSERT INTO `web_help` (`fd_help_id`, `fd_help_no`, `fd_help_type`, `fd_help_name`, `fd_help_url`, `fd_help_contect`, `fd_help_state`, `fd_help_date`) VALUES(2, 2, 1, '如何获得通付宝', '', '通付宝官方购价499元，建议您到明盛指定地点购买，或者播打明盛客服电话：4006868956，以免造成经济支损失。', 0, '2013-08-23');
INSERT INTO `web_help` (`fd_help_id`, `fd_help_no`, `fd_help_type`, `fd_help_name`, `fd_help_url`, `fd_help_contect`, `fd_help_state`, `fd_help_date`) VALUES(3, 3, 1, '转帐汇款使用指南', '', '转帐汇款，实现两个储蓄卡间的资金划转。点首页的“转帐汇款”进入操作页，分别输入收款人卡号、姓名、转帐金额，选择期望到帐日期，插入刷卡器刷待付款的储蓄卡，以确认付款帐号，下一步输入开户人姓名、身份证号，确认转帐。转账汇款操作成功。', 0, '2013-08-23');
INSERT INTO `web_help` (`fd_help_id`, `fd_help_no`, `fd_help_type`, `fd_help_name`, `fd_help_url`, `fd_help_contect`, `fd_help_state`, `fd_help_date`) VALUES(4, 4, 1, '信用卡还款使用指南', '', '借记卡对信用卡的还款。点首页的“信用卡还款”进入操作页，插入刷卡器刷待还款的信用卡，确认信用卡帐号，并输入还款金额，再次插入刷卡器刷用于还款的借记卡，下一步输入开户人姓名、身份证号，确认还款。信用卡还款操作成功。', 0, '2013-08-23');
INSERT INTO `web_help` (`fd_help_id`, `fd_help_no`, `fd_help_type`, `fd_help_name`, `fd_help_url`, `fd_help_contect`, `fd_help_state`, `fd_help_date`) VALUES(5, 5, 1, '我的钱包使用指南', '', '您在明盛商城资金帐户里的钱会同步至通付宝“我的钱包”中，在“我的钱包”中您能够进行信用卡、储蓄卡的充值和非贷款金额转账至储蓄银行卡等服务。', 0, '2013-08-23');
INSERT INTO `web_help` (`fd_help_id`, `fd_help_no`, `fd_help_type`, `fd_help_name`, `fd_help_url`, `fd_help_contect`, `fd_help_state`, `fd_help_date`) VALUES(6, 6, 1, '现金抵用券使用指南', '', '现金抵用券支持信用卡购买。选择抵用券的额度和数量后，插入刷卡器刷您的信用卡后，输入卡的有效期、进行支付购买。抵用券可用于明盛商城购买下单时抵用现金。', 0, '2013-08-23');
INSERT INTO `web_helpset` (`fd_helpset_id`, `fd_helpset_name`) VALUES(7, '使用手册');
